  <title>Location Tracking App</title>
  <script src="https://code.jquery.com/jquery-3.6.0.min.js"></script>
  <script>
    $(document).ready(function(){
      // Initialize location tracking function
      function trackLocation() {
        if (navigator.geolocation) {
          navigator.geolocation.getCurrentPosition(
            function(position) {
              console.log("User's current position: " + position.coords.latitude + ", " + position.coords.longitude);
            },
            function() {
              console.log("Geolocation is not supported by this browser.");
            }
          );
        } else {
          console.log("Geolocation is not supported by this device.");
        }
      }

      // Check if user has denied location permissions
      var permissionStatus = navigator.geolocation.permission;
      if (permissionStatus !== "granted") {
        console.log("Location tracking requires user's consent to access their location.");
        return;
      }

      // Track user's location every 30 seconds
      setInterval(trackLocation, 30000);
    });
  </script>
