    // Add a new record to the database every time the user's location is tracked
    function onLocationTracked(locationCoordinates) {
      var query = from entry in db.Entries
                   where entry.Location == null && entry.UserId == User.Identity.Name
                   select entry;

      foreach (var entry in query) {
        entry.Location = locationCoordinates.coords.latitude + "," + locationCoordinates.coords.longitude;
        db.SaveChanges(); // Replace with your database update method
      }
    }

